from collections import Counter, defaultdict
from math import inf
class Solution:
    def minWindow(self, s: str, t: str) -> str:
        loan=defaultdict(lambda : 0)
        setOflettersInT=set(t)
        initialJ=0
        TCount=Counter(t)
        minL=inf
        out=""
        key=None
        for i in range(len(s)-len(t)+1):
            if i and not out:
                return out
            if i and s[i-1] in setOflettersInT:
                    TCount[s[i-1]]=1
                    key=s[i-1]
            if TCount and key in loan:
                    TCount[key]-=1
                    loan[key]-=1
                    if not TCount[key]:
                        TCount.pop(key)
                    if not loan[key]:
                        loan.pop(key)
            if TCount:                    
                for j in range(initialJ, len(s)):
                    if s[j] in TCount:
                        TCount[s[j]]-=1
                        if not TCount[s[j]]:
                            TCount.pop(s[j])
                            if not TCount:
                                length=j-i+1
                                initialJ=j+1
                                if length<minL:
                                    out=s[i:j+1]
                                    minL=length
                                break
                    elif s[j] in setOflettersInT:
                        loan[s[j]]+=1
            else:
                length=j-i+1
                if length<minL:
                    out=s[i:j+1]
                    minL=length

        return out
if __name__=="__main__":
    s = ""
    t=""
    # s="bbabb"
    # t="baba"
    print(Solution().minWindow(s=s,t=t))